import React from "react";


const Groups = () => {

    const [lg, setState] = React.useState([
        {id:1, img:"../img/cake.PNG", name:"cake group"},

    ]);

    return (
        <div>
            {lg.map((i) => (

                <div>
                    <img src={i.img} />
                </div>


            ))}
        </div>

    )
}

export default Groups;
